import "./App.css";
import { BrowserRouter, Link, Route, Routes } from "react-router-dom";
import LandingPage from "./LandingPage";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route element={<LandingPage />} path="/" />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
